"use strict";(self.webpackChunkjavascript=self.webpackChunkjavascript||[]).push([[859],{859:(s,t,e)=>{e.r(t),e.d(t,{title:()=>o,story:()=>d});const o="Operators",d='\n<div>\n    <div class="section">\n        <b>Arithmetic Operators</b>\n        <br>\n        Are used for arithmetic operations.\n        <hr>\n        <div class="table-container">\n            <table class="table table-hover table-borderless table-sm">\n                <thead>\n                    <tr class="table-light">\n                        <th scope="col">Op</th>\n                        <th scope="col">Name</th>\n                        <th scope="col">Eg.</th>\n                        <th scope="col">Comments</th>\n                    </tr>\n                </thead>\n                <tbody>\n                    <tr>\n                        <th>\n                            <code>\n                        +\n                    </code>\n                        </th>\n                        <td>Addition</td>\n                        <td>\n                            <code>let foo = 2 + 3</code>\n                        </td>\n                        <td>\n                            Assign value 5 to foo\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                        -\n                    </code>\n                        </th>\n                        <td>Subtraction</td>\n                        <td>\n                            <code>let foo = 2 - 3</code>\n                        </td>\n                        <td>\n                            Assign value -1 to foo\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                        *\n                    </code>\n                        </th>\n                        <td>Multiplication</td>\n                        <td>\n                            <code>let foo = 2 * 3</code>\n                        </td>\n                        <td>\n                            Assign value 6 to foo\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            /\n                        </code>\n                        </th>\n                        <td>Division</td>\n                        <td>\n                            <code>let foo = 2 / 3</code>\n                        </td>\n                        <td>\n                            Assign value 0.666666 to foo\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            %\n                        </code>\n                        </th>\n                        <td>Modulus</td>\n                        <td>\n                            <code>let foo = 2 % 3</code>\n                        </td>\n                        <td>\n                            Assign modulus value 2 to foo\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            **\n                        </code>\n                        </th>\n                        <td>Exponentiation</td>\n                        <td>\n                            <code>let foo = 2 ** 3</code>\n                        </td>\n                        <td>\n                            Assign 2 raise to 3 value 8 to foo\n                        </td>\n                    </tr>\n                </tbody>\n            </table>\n        </div>\n    </div>\n\n    <div class="section">\n        <b>(Value) Assignment Operators</b>\n        <br>\n        Are used to assign values to variables.\n        <hr>\n        <div class="table-container">\n            <table class="table table-hover table-borderless table-sm">\n                <thead>\n                    <tr class="table-light">\n                        <th scope="col">Op</th>\n                        <th scope="col">Name</th>\n                        <th scope="col">Eg.</th>\n                        <th scope="col">Comments</th>\n                    </tr>\n                </thead>\n\n                <tbody>\n                    <tr>\n                        <th>\n                            <code>\n                        =\n                    </code>\n                        </th>\n                        <td>Assignment</td>\n                        <td>\n                            <code>let foo = 2</code>\n                        </td>\n                        <td>\n                            Assign value 2 to foo\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            +=\n                        </code>\n                        </th>\n                        <td>Add and assign</td>\n                        <td>\n                            <code>let foo = 2; foo += 3</code>\n                        </td>\n                        <td>\n                            Assign value 2 to foo & then add 3 to foo i.e. 5\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            -=\n                        </code>\n                        </th>\n                        <td>Subtract and assign</td>\n                        <td>\n                            <code>let foo = 2; foo -= 3</code>\n                        </td>\n                        <td>\n                            Assign value 2 to foo & then subtract 3 from foo i.e. -1\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            *=\n                        </code>\n                        </th>\n                        <td>Multiply and assign</td>\n                        <td>\n                            <code>let foo = 2; foo *= 3</code>\n                        </td>\n                        <td>\n                            Assign value 2 to foo & then multiply 3 to foo i.e. 6\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            /=\n                        </code>\n                        </th>\n                        <td>Divide and assign</td>\n                        <td>\n                            <code>let foo = 2; foo /= 3</code>\n                        </td>\n                        <td>\n                            Assign value 2 to foo & then divide by 3 to foo i.e. 0.666666\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            %=\n                        </code>\n                        </th>\n                        <td>Modulus and assign</td>\n                        <td>\n                            <code>let foo = 2; foo %= 3</code>\n                        </td>\n                        <td>\n                            Assign value 2 to foo & then modulus by 3 to foo i.e. 2\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            **=\n                        </code>\n                        </th>\n                        <td>Exponentiate and assign</td>\n                        <td>\n                            <code>let foo = 2; foo **= 3</code>\n                        </td>\n                        <td>\n                            Assign value 2 to foo & then exponentiate by 3 to foo i.e. 8\n                        </td>\n                    </tr>\n                </tbody>\n            </table>\n        </div>\n    </div>\n\n    <div class="section">\n        <b>Logical Operators</b>\n        <br>\n        Are used to evaluate conditions.\n        <hr>\n        <div class="table-container">\n            <table class="table table-hover table-borderless table-sm">\n                <thead>\n                    <tr class="table-light">\n                        <th scope="col">Op</th>\n                        <th scope="col">Name</th>\n                        <th scope="col">Eg.</th>\n                        <th scope="col">Comments</th>\n                    </tr>\n                </thead>\n\n                <tbody>\n                    <tr>\n                        <th>\n                            <code>\n                        &&\n                    </code>\n                        </th>\n                        <td>Logical AND</td>\n                        <td>\n                            <code>let a = true ; b= false</code>\n                            <br>\n                            <code>let foo = a && b</code>\n                            <code class="text-success"> // false </code>\n                        </td>\n                        <td>\n                            _ Assign value false to foo if both a and b are false\n                            <br>\n                            _ Assign value true to foo if both a and b are true\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            ||\n                        </code>\n                        </th>\n                        <td>Logical OR</td>\n                        <td>\n                            <code>let a = true ; b= false</code>\n                            <br>\n                            <code>let foo = a || b</code>\n                            <code class="text-success"> // true </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if either a or b is true\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            !\n                        </code>\n                        </th>\n                        <td>Logical NOT</td>\n                        <td>\n                            <code>let foo = !false</code>\n                            <code class="text-success"> // true </code>\n                        </td>\n                        <td>\n                            Assign value true (negation of false) to foo\n                        </td>\n                    </tr>\n                </tbody>\n            </table>\n        </div>\n    </div>\n\n    <div class="section">\n        <b>Relational Operators</b>\n        <br>\n        Are used to compare values.\n        <hr>\n        <div class="table-container">\n            <table class="table table-hover table-borderless table-sm">\n                <thead>\n                    <tr class="table-light">\n                        <th scope="col">Op</th>\n                        <th scope="col">Name</th>\n                        <th scope="col">Eg.</th>\n                        <th scope="col">Comments</th>\n                    </tr>\n                </thead>\n\n                <tbody>\n                    <tr>\n                        <th>\n                            <code>\n                        <\n                    </code>\n                        </th>\n                        <td>Less than</td>\n                        <td>\n                            <code>let a = 2 ; b = 3</code>\n                            <br>\n                            <code>let foo = (a < b)</code>\n                            <code class="text-success"> // true </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is less than b\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            >\n                        </code>\n                        </th>\n                        <td>Greater than</td>\n                        <td>\n                            <code>let a = 2 ; b = 3</code>\n                            <br>\n                            <code>let foo = (a > b)</code>\n                            <code class="text-success"> // false </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is greater than b\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            <=\n                        </code>\n                        </th>\n                        <td>Less than or equal to</td>\n                        <td>\n                            <code>let a = 2 ; b = 3</code>\n                            <br>\n                            <code>let foo = (a <= b)</code>\n                            <code class="text-success"> // true </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is less than or equal to b\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            >=\n                        </code>\n                        </th>\n                        <td>Greater than or equal to</td>\n                        <td>\n                            <code>let a = 2 ; b = 3</code>\n                            <br>\n                            <code>let foo = (a >= b)</code>\n                            <code class="text-success"> // false </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is greater than or equal to b\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            ==\n                        </code>\n                        </th>\n                        <td>Equal to</td>\n                        <td>\n                            <code>let a = 2 ; b = \'3\'</code>\n                            <br>\n                            <code>let foo = (a == b)</code>\n                            <code class="text-success"> // false </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is equal to b\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            ===\n                        </code>\n                        </th>\n                        <td>Strictly equal to</td>\n                        <td>\n                            <code>let a = 2 ; b = \'3\'</code>\n                            <br>\n                            <code>let foo = (a === b)</code>\n                            <code class="text-success"> // false </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is strictly equal to b\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            !=\n                        </code>\n                        </th>\n                        <td>Not equal to</td>\n                        <td>\n                            <code>let a = 2 ; b = 3</code>\n                            <br>\n                            <code>let foo = (a != b)</code>\n                            <code class="text-success"> // true </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is not equal to b\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            <code>\n                            !==\n                        </code>\n                        </th>\n                        <td>Strictly not equal to</td>\n                        <td>\n                            <code>let a = 2 ; b = 3</code>\n                            <br>\n                            <code>let foo = a !== b</code>\n                            <code class="text-success"> // true </code>\n                        </td>\n                        <td>\n                            Assign value true to foo if a is strictly not equal to b\n                        </td>\n                    </tr>\n                </tbody>\n            </table>\n        </div>\n    </div>\n    '}}]);